{"language":"Solidity","sources":{"mutlisend.sol":{"content":"// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract MultiSend {
    // Function to send Ether to multiple addresses
    function multiSend(address payable[] memory recipients) public payable {
        uint256 amountPerRecipient = msg.value / recipients.length;

        require(amountPerRecipient > 0, "Not enough Ether sent");

        for (uint256 i = 0; i < recipients.length; i++) {
            // Transfer Ether to each recipient
            (bool success, ) = recipients[i].call{value: amountPerRecipient}("");
            require(success, "Transfer failed");
        }
    }
}
